import "./App.css";
import "./reset.css";
import { useEffect, useState } from "react";
import React, { PureComponent } from "react";
import {
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  CartesianGrid,
  LineChart,
  Line,
} from "recharts";

function App() {
  const [data, setData] = useState();

  useEffect(() => {
    (async () => {
      const result = await fetch(
        "http://localhost:8000/fx"
        // "https://www.alphavantage.co/query?function=FX_DAILY&from_symbol=USD&to_symbol=JPY&apikey=4THZE2SRL8MOGD1C"
      );
      const json = await result.json();
      if (json.train && json.valid) {
        const dataList = [
          ...Object.entries(JSON.parse(json.train).close),
          ...Object.entries(JSON.parse(json.valid).close),
        ];
        setData(dataList);
      }
    })();
  }, []);

  return (
    <div>
      {/* {JSON.stringify(data)} */}

      <LineChart
        width={500}
        height={300}
        data={[
          ...Object.entries(JSON.parse(json.train).close),
          ...Object.entries(JSON.parse(json.valid).close),
        ]}
        margin={{
          top: 5,
          right: 30,
          left: 20,
          bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Line
          type="monotone"
          dataKey="pv"
          stroke="#8884d8"
          activeDot={{ r: 8 }}
        />
        <Line type="monotone" dataKey="uv" stroke="#82ca9d" />
      </LineChart>
    </div>
  );
}
export default App;
